import React, { useContext } from 'react'
import { GlobalContext } from '../contextGlobalState'
export const TransactionList = () => {

    const context = useContext(GlobalContext);

    return (
        <>
            <h3>History</h3>
            <ul className="list">
                <li className="minus">
                Cash <span>-$400</span><button className="delete-btn">x</button>
                </li> 
            </ul>
        </>
    )
}
